import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the cart element
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot of opened cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal.png'));

    // Extract cart information
    const cartInfo = await page.evaluate(() => {
      const cartCount = document.querySelector('.cart').innerText.trim();
      const cartItems = document.querySelectorAll('.cart-item');
      const cartTotal = document.querySelector('#cartTotal')?.innerText || '0.00';

      return {
        cartCount,
        itemCount: cartItems.length,
        totalAmount: cartTotal
      };
    });

    return {
      success: true,
      action: "Opened shopping cart modal successfully",
      extractedData: cartInfo,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open shopping cart modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
